% % Synthetic Load demand
% L1=SyntheticLoaddemand(hours);

%% % Hybrid input: PV production + Wind meteorological
power_profiles = struct();
power_profiles.type = 'production';
% Solar: direct production profile
power_profiles.solar.type = 'production';
power_profiles.solar.data = PV_production_kW;  % 8760x1 vector

% % Wind: meteorological data
power_profiles.wind.type = 'production';
power_profiles.wind.data = wind_production_kW;             % 8760x1 vector

% Wind: meteorological data
% power_profiles.wind.type = 'meteorological';
% power_profiles.wind.data = WS_ref;             % 8760x1 vector wind_production_kW

% Geothermal: direct production (optional)
power_profiles.geothermal.type = 'production';
power_profiles.geothermal.data = GT_production_kW;






%PLC, ESSAg, BSD, SSD, NLPS,

% f = RF20_WP32_KARA_LPF_v2([53.985151887951820,4.477139742856600,0.487780383313323], 3, 0, 0, 0, 0, true, 'LFP', 'KARA', 'HYB', L1, power_profiles);
%







%% 1) Scenario grids
PVSF_vals     = [15];  % PV Plant Scaling Factor [1,2,4,6]
PLC_vals      = [1];  % Peak Load Tariff included/not included
ESSAg_vals    = [0];  % Consider battery aging
BSD_vals      = [0];  % Consider battery self-discharge
CSD_vals      = [0];  % Consider supercap self-discharge
factor_vals     = [0];  % efficency [1,1.5,2,2.5]
battery_types = {'LFP'};                     % {'LFP','NMC','LTO',...}
ESS_conf      = {'BAT'};          % Hybrid, Battery-only, SC-only ,'BAT','SC'

nPVSF    = numel(PVSF_vals);
nPLC     = numel(PLC_vals);
nESS     = numel(ESSAg_vals);
nBSD     = numel(BSD_vals);
nCSD     = numel(CSD_vals);
nNLPS    = numel(factor_vals);
nBatt    = numel(battery_types);
nESSConf = numel(ESS_conf);

nScenarios =  nPLC * nESS * nBSD * nCSD * nNLPS * nBatt * nESSConf;

%% 2) GA settings


pareto_fractions = [0.35];

% --- 2. Define other GA options (except ParetoFraction) ---
base_options = optimoptions('gamultiobj', ...
    'PopulationSize', 1000, ...
    'MaxGenerations', 500, ...
    'Display', 'iter', ...
    'UseParallel', true, ...
    'PlotFcn', @gaplotpareto);

%% 3) Preallocate cell arrays for results
Pareto_solutions = cell(nScenarios,1);
Pareto_Fval      = cell(nScenarios,1);
Scenario_info    = cell(nScenarios,1);
TOPSIS           = cell(nScenarios,1);

%% 4) Load required input data
% load('input_data.mat', 'L1', 'PVprofile', 'WTprofile', 'GTprofile', 'WS_ref', 'T', 'IR', 'facility');

% --- 5. Loop over each ParetoFraction value ---
for pf_idx = 1:length(pareto_fractions)
    ParetoFraction_cur = pareto_fractions(pf_idx);

    % Set GA options for this ParetoFraction
    options = base_options;
    options.ParetoFraction = ParetoFraction_cur;

    % Preallocate cell arrays for results
    Pareto_solutions = cell(nScenarios,1);
    Pareto_Fval      = cell(nScenarios,1);
    Scenario_info    = cell(nScenarios,1);
    TOPSIS           = cell(nScenarios,1);

    idx = 1;
    for ip = 1 : nPVSF
        PVSF_cur = PVSF_vals(ip);
        for ij = 1 : nPLC
            PLC_cur = PLC_vals(ij);
            for ik = 1 : nESS
                ESSAg_cur = ESSAg_vals(ik);
                for il = 1 : nNLPS
                    % NLPS_cur = NLPS_vals(il);
                    factor_cur=factor_vals(il)/100;
                    for im = 1 : nBatt
                        batt_cur = battery_types{im};
                        for in = 1 : nBSD
                            BSD_cur = BSD_vals(in);
                            for iq = 1 : nCSD
                                CSD_cur = CSD_vals(iq);
                                for is = 1 : nESSConf
                                    ESSConf_cur = ESS_conf{is};
                                    if strcmp(ESSConf_cur, 'BAT')
                                        nVars = 2;               % [N_BAT,  Alpha]
                                        LB = [0, 1e-10];
                                        UB = [1000, 0.49]; %for kara i was 5000,500,0.49,6
                                    elseif strcmp(ESSConf_cur, 'SC')
                                        nVars = 2;               %  N_SC, Alpha]
                                        LB = [0, 1e-10];
                                        UB = [1000, 0.49]; %for kara i was 5000,500,0.49,6
                                    elseif strcmp(ESSConf_cur, 'HYB')
                                        nVars = 3;               % [N_BAT, N_SC, Alpha]
                                        LB = [0, 0, 1e-10];
                                        UB = [1000,1000, 0.49]; %for kara i was 5000,500,0.49,6
                                    end
                                    NLPS_cur=1;
                                    % Display scenario
                                    fprintf( ...
                                        'PF=%.2f | Scenario %d/%d: PVSF=%d, PLC=%d, ESSAg=%d, BSD=%d, CSD=%d, NLPS=%d, battery=%s, ESSConf=%s,factor=%s\n', ...
                                        ParetoFraction_cur, idx, nScenarios, ...
                                        PLC_cur, ESSAg_cur, BSD_cur, CSD_cur, NLPS_cur, ...
                                        batt_cur, ESSConf_cur);

                                    % Define the objective function handle
                                    fun = @(x) objective_function( ...
                                        x, PVSF_cur, PLC_cur, ESSAg_cur, BSD_cur, CSD_cur, NLPS_cur, ...
                                        batt_cur, facility, ESSConf_cur, L1, power_profiles,factor_cur);

                                    % Run multiobjective GA
                                    [x_sol, fval] = gamultiobj( ...
                                        fun, nVars, [], [], [], [], LB, UB, [], options);

                                    

                                    % Store Pareto results
                                    Pareto_solutions{idx} = x_sol;
                                    Pareto_Fval{idx}      = fval;

                                    % TOPSIS ranking
                                    Min_OR_Max     = -1;
                                    Weighting_factor = [0.6, 0.4];
                                    TOPSIS{idx}    = topsis(fval, Weighting_factor, Min_OR_Max);
                                    [~, best_idx]  = max(TOPSIS{idx});
                                    optimal_objective_values  = fval(best_idx, :);
                                    optimal_decision_variables = x_sol(best_idx, :);

                                    % Save scenario info
                                    Scenario_info{idx} = struct( ...
                                        'PLC',      PLC_cur, ...
                                        'PVSF',      PVSF_cur, ...
                                        'ESSAg',    ESSAg_cur, ...
                                        'BSD',      BSD_cur, ...
                                        'CSD',      CSD_cur, ...
                                        'NLPS',     NLPS_cur, ...
                                        'Battery',  batt_cur, ...
                                        'ESS_Conf', ESSConf_cur, ...
                                        'Factor', factor_cur, ...
                                        'Solution', Pareto_solutions{idx}, ...
                                        'Obj_Function', Pareto_Fval{idx}, ...
                                        'TOPSIS_Ranking', TOPSIS{idx}, ...
                                        'optimal_objective_values',  optimal_objective_values, ...
                                        'optimal_decision_variables', optimal_decision_variables);

                                    idx = idx + 1;
                                end
                            end
                        end
                    end
                end
            end
        end
    end

    % --- 6. Save results for this ParetoFraction ---
    pf_str = num2str(ParetoFraction_cur*10); % e.g., 3, 5, 7
    filename = sprintf('AllScenarios_Paretofraction_MAXIV_AGEING.mat', pf_str);

%%
    save(filename, 'Scenario_info', 'Pareto_solutions', 'Pareto_Fval', 'TOPSIS');
    %%
    fprintf('Done! Results saved to %s\n', filename);
end



